import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Router from './Router';
import * as serviceWorker from './serviceWorker';

ReactDOM.render(
    <CtxProvider>
    <Router />
    </CtxProvider>, document.getElementById('root'));

serviceWorker.unregister();
